import React, { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";
import SearchBar from "../components/SearchBar";

const Home = ({ setUser }) => {
    const [weatherData, setWeatherData] = useState(null);
    const [user, setUserState] = useState(null);
    const navigate = useNavigate();

    // Check Login State
    useEffect(() => {
        const storedUser = localStorage.getItem("user");
        if (storedUser) {
            setUserState(JSON.parse(storedUser));
        } else {
            navigate("/login"); // Jump to Login page
        }
    }, [navigate]);

    // Logout (only navigate, do not delete local record)
    const handleLogout = () => {
        navigate("/login"); // Just go to the login page
    };

    // Delete (remove user record and navigate)
    const handleDelete = () => {
        localStorage.removeItem("user"); // delete local user record
        setUser(null);
        setUserState(null);
        navigate("/login"); // Jump to Login page
    };

    return (
        <div>
            <h1>Weather App</h1>
            {user && (
                <div>
                    <p>Welcome, {user.username}!</p>
                    <button onClick={handleLogout}>Logout</button>
                    <button onClick={handleDelete} style={{ marginLeft: "10px", color: "red" }}>Delete Account</button>
                </div>
            )}

            <SearchBar setWeatherData={setWeatherData} />

            {weatherData && weatherData.current_weather ? (
                <div>
                    <h2>{weatherData.location || "Unknown Location"}'s Weather</h2>
                    <p>Weather: {weatherData.current_weather?.weather || "N/A"}</p>
                    <p>Temperature: {weatherData.current_weather?.temperature || "N/A"}°C</p>
                    <p>Humidity: {weatherData.current_weather?.humidity || "N/A"}%</p>
                    <p>Wind Speed: {weatherData.current_weather?.wind_speed || "N/A"} km/h</p>

                    <h3>Past 3 Days Weather:</h3>
                    {weatherData.past_weather?.length > 0 ? (
                        weatherData.past_weather.map((day, index) => (
                            <div key={index}>
                                <p>{day.date}:</p>
                                <p>Max Temp: {day.temperature_max}°C</p>
                                <p>Min Temp: {day.temperature_min}°C</p>
                                <p>Precipitation: {day.precipitation} mm</p>
                                <p>Weather Code: {day.weather_code}</p>
                            </div>
                        ))
                    ) : (
                        <p>No past weather data available.</p>
                    )}

                    <h3>Future 2 Days Weather:</h3>
                    {weatherData.future_weather?.length > 0 ? (
                        weatherData.future_weather.map((day, index) => (
                            <div key={index}>
                                <p>{day.date}: {day?.weather || "N/A"}</p>
                                <p>Temperature: {day?.temperature || "N/A"}°C</p>
                                <p>Humidity: {day?.humidity || "N/A"}%</p>
                                <p>Wind Speed: {day?.wind_speed || "N/A"} km/h</p>
                            </div>
                        ))
                    ) : (
                        <p>No future weather data available.</p>
                    )}
                </div>
            ) : (
                <p>Enter coordinates and fetch weather data.</p>
            )}
        </div>
    );
};

export default Home;
